import styled from 'styled-components'

const Nav = styled.nav`
    color: blue;
    width: 90%;
    display: flex;
    justify-content: center;

    ul{
        list-style-type: none;
        display: flex;
    }

    li{
        margin: 1em;
    }
`;

const Navbar = () => {
    return (
        <Nav>
            <ul>
                <li>Sizing</li>
                <li>On Hold</li>
                <li>Archive</li>
            </ul>
        </Nav>
    )
}

export default Navbar
